import React from 'react';
import './Header.css'
import puky from '../asse'
const Header = () => {
  return (
  <div className='header'>
     <div className='logoContainer'>
         <img src={puky} className='pukyLogo' alt=''/>
     </div>
  </div>
  )
};

export default Header;
